contracts/Greeting.sol.content:
pragma solidity ^0.4.26;
contract Greeting{
    address creator;
    string message;

    function Greeting(string _message) public {
    message = _message;
    creator = msg.sender;
}

    function greet() public constant returns (string) {
        return message;
    }

    function setGreeting(string _message) public {
        message = _message;
}
}

